<head>
	<title>Collection Web View | Postman</title>
	<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.4.1/css/bootstrap.min.css">
	<link rel="icon" type="image/png" href="https://st-ar.cdn.postman.com/images/favicon-1-16.png" sizes="16x16"
		nonce="">
	<link rel="icon" type="image/png" href="https://st-ar.cdn.postman.com/images/favicon-1-32.png" sizes="32x32"
		nonce="">
	<link rel="icon" type="image/png" href="https://st-ar.cdn.postman.com/images/favicon-1-48.png" sizes="48x48"

	<style type="text/css">
		body {
			background-color: #fafafa;
			height: 100vh;
		}

		.pm-header {
			padding: 10px;
			display: block;
			position: absolute;
			height: 70px;
			z-index: 100;
			line-height: 50px;
			background-color: #ffffff;
			border-bottom: 1px solid #f0f0f0;
			top: 0;
			left: 0;
			right: 0;
		}

		.pm-header a {
			color: #ef5b25;
			font-family: "Open Sans", sans-serif;
			cursor: pointer;
			font-style: normal;
			font-size: 16px;
			text-decoration: none;
			width: 100%;
		}


		.pm-header__name {
			top: 30px;
			padding-left: 8px;
		}

		.page-wrap {
			height: 600px;
		}

		.pm-page-wrap-white {
			background: #fbfbfb;
		}

		footer {
			left: 50%;
			top: 550px;
			color: rgb(107, 107, 107);
			font-size: 11px;
			line-height: 1.4;
			max-width: 400px;
			position: absolute;
			z-index: 999999999;
			text-align: center;
			margin-left: -200px;
			padding: 0 15px 80px;
		}

		footer a {
			text-decoration: underline;
			color: inherit;
		}

		footer a:hover {
			text-decoration: underline;
			color: rgb(2, 101, 210);
		}

		.footer-container {
			padding: 40px 0;
			background-color: #fafafa;
			box-shadow: 0 -1px 3px rgba(0, 0, 0, .2);
			position: absolute;
			bottom: -90px;
			width: 100%;
		}

		.footer-links {
			margin: 0;
			padding: 0;
			line-height: 45px;
		}

		@media (min-height: 800px) {
			.footer-container {
				padding: 40px 0;
				background-color: #fafafa;
				box-shadow: 0 -1px 3px rgba(0, 0, 0, .2);
				position: absolute;
				bottom: 0px;
				width: 100%;
			}
		}

		@media (max-height: 650px) {
			.footer-container {
				padding: 40px 0;
				background-color: #fafafa;
				box-shadow: 0 -1px 3px rgba(0, 0, 0, .2);
				position: absolute;
				top: 650px;
				width: 100%;
			}
		}

		.footer-links li {
			list-style: none;
			float: left;
			margin-right: 20px;
		}

		.footer-links a {
			color: #808080;
			font-size: 16px;
			text-decoration: none;
			font-family: "Open Sans", sans-serif;
		}

		.footer-social-links {
			margin: 0;
			padding: 0;
		}

		.footer-social-links li {
			list-style: none;
			float: left;
			margin-right: 20px;
		}

		.pm-social-media {
			display: inline-block;
			width: 24px;
			height: 24px;
			margin-top: 10px;
		}
